import { styled } from '@mui/material/styles'
import { Box } from "@mui/material";
import React from "react";
import Editor from "./Editor";

const Container = styled(Box)`
    background-color: #060606;
    height: 50vh;
    display: flex;
`

const Code = () => {
  return (
    <Container>
        <Editor />
        <Editor />
        <Editor />
    </Container>
  )
};

export default Code;
